import img1 from "./images/bugatti.jpg";
import img2 from "./images/white.jpg";
import img3 from "./images/moderno.jpg";

import img4 from "./images/leon.jpg";
import img5 from "./images/tigres.jpg";
import img6 from "./images/lobos.jpg";

import img7 from "./images/mujer.jpg";
import img8 from "./images/china.jpg";
import img9 from "./images/mujeres.jpg";

import img10 from "./images/sessho.jpg";
import img11 from "./images/inuyasha2.jpg";
import img12 from "./images/inuyasha.jpg";

export const data = [
    {
        "id": "buzos",
        "title": "Presentación de buzos",
        "description": "Este servicio es opcional para los clientes que deseen cubrir este evento en particular y  será acordado con nuestro fotógrafo profesional.",
        "img": {
            "img1": img1,
            "img2": img2,
            "img3": img3
        }
    },
    {
        "id": "book",
        "title": "Book día libre",
        "description": "Este servicio es opcional para los clientes que deseen cubrir este evento. Será acordado entre los clientes y nuestros fotógrafos. DIA / HORA/  LUGAR DE ENCUENTRO.",
        "img": {
            "img1": img4,
            "img2": img5,
            "img3": img6
        }
    },
    {
        "id": "colacion",
        "title": "Colación",
        "description": "Este servicio es opcional para los clientes que deseen cubrir este evento.              Dicho servicio incluye servicios de fotografía en el acto de colación y una fotografía individual impresa de regalo.",
        "img": {
            "img1": img7,
            "img2": img8,
            "img3": img9
        }
    },
    {
        "id": "cena",
        "title": "Cena de egresados",
        "description": "cena de egresados para todos",
        "img": {
            "img1": img10,
            "img2": img11,
            "img3": img12
        }
    }
];
